        if ($elements.length > 0) {
            for (var i = 0; i < $elements.length; i++) {
                var $element = $($elements[i]);
                var nameOfElement = $element.attr("name");
                var valueOfElement = $element.attr("value");
                var pushingElement = {
                    name: nameOfElement,
                    value: valueOfElement
                };
                addFields.push(pushingElement);
            }

        }
        return addFields;
